import React, { useContext, useEffect } from "react";
import { GlobalContext } from "../context/GlobalState";
import Navigation from "../components/layout/Navigation";
import Modal from "../components/modals/Modal";
import { ChevronDown } from "react-feather";

const Quote = () => {
  const { getCarInfo } = useContext(GlobalContext);

  useEffect(() => {
    getCarInfo(); // eslint-disable-next-line
  }, []);

  return (
    <>
      <div className="parent">
        <div className="main">
          <Navigation />
          <section className="quote-display">
            <div className="container-fluid">
              <div className="row specific-quote">
                <div className="col-md-8 col-12">
                  <div className="quote-content">
                    <div className="quote-intro p-3">kicks</div>
                    <div className="quote-summary p-3">kicks</div>
                  </div>
                </div>
                <div className="col-md-4 col-12">
                  <div className="quote-content p-3">
                    <h6>
                      <span>About the content</span>
                      <button>
                        <ChevronDown size={15} />
                      </button>
                    </h6>
                  </div>
                  <div className="quote-content p-3">
                    <h6>
                      <span>About the content</span>
                      <button>
                        <ChevronDown size={15} />
                      </button>
                    </h6>
                  </div>
                </div>
              </div>
            </div>
          </section>
        </div>
        <Modal />
      </div>
    </>
  );
};

export default Quote;
